declare namespace java {
    namespace security {
        /**
         * This exception is thrown if an entry in the keystore cannot be recovered.
         * @since 1.5
         */
        // @ts-ignore
        class UnrecoverableEntryException extends java.security.GeneralSecurityException {
            /**
             * Constructs an UnrecoverableEntryException with no detail message.
             */
            // @ts-ignore
            constructor()
            /**
             * Constructs an UnrecoverableEntryException with the specified detail
             * message, which provides more information about why this exception
             * has been thrown.
             * @param msg the detail message.
             */
            // @ts-ignore
            constructor(msg: java.lang.String | string)
        }
    }
}
